import { initializeApp } from 'firebase/app';
import {
  getAuth,
  signInWithRedirect,
  signInWithPopup,
  GoogleAuthProvider,
} from 'firebase/auth';

const firebaseConfig = {
  apiKey: "AIzaSyBc4TiVk1m0_h7bCqQ0K5RQMnpc4R5v2pU",
  authDomain: "hua-clothing-db.firebaseapp.com",
  projectId: "hua-clothing-db",
  storageBucket: "hua-clothing-db.appspot.com",
  messagingSenderId: "657692789500",
  appId: "1:657692789500:web:e3cb643d2b815ae5156579",
};

const firebaseApp = initializeApp(firebaseConfig);

const provider = new GoogleAuthProvider();

provider.setCustomParameters({
  prompt: 'select_account',
});

export const createUserProfileDocument = async (userAuth, additionalData) => {
  if (!userAuth) return;

  console.log(userAuth);
};

export const auth = getAuth();
export const signInWithGooglePopup = () => signInWithPopup(auth, provider);
